          descImage.Visible = descLabel.Text == string.Empty;
          this._toolTip.SetToolTip(descImage, descFieldId);
        }
      }
      if (statusImage != null)
      {
        statusImage.Image = (Image) this.GetStatusImage(statusFieldId);
        this._toolTip.SetToolTip((Control) statusImage, statusFieldId);
      }
      if (dateLabel == null)
        return;
      dateLabel.Text = dateFieldId != "N/A" ? this._loan.GetSimpleField(dateFieldId).FormatDatetime(this._dateFormat) : "N/A";
      this._toolTip.SetToolTip(dateLabel, dateFieldId);
      if (dateImage == null)
        return;
      dateImage.Visible = dateLabel.Text == string.Empty;
      this._toolTip.SetToolTip(dateImage, dateFieldId);
    }

    private double GetDoubleValue(string value)
    {
      try
      {
        return double.Parse(value);
      }
      catch
      {
        return 0.0;
      }
    }

    private string GetFreddieRiskClass()
    {
      string value = this._loan.GetSimpleField("CASASRN.X34");
      List<string> source = new List<string>()
      {
        "Refer",
        "Accept",
        "Caution"
      };
      string str;
      try
      {
        str = source.FirstOrDefault<string>((Func<string, bool>) (x => x.Equals(value, StringComparison.OrdinalIgnoreCase)));
      }
      catch
      {
        return string.Empty;
      }
      return !string.IsNullOrEmpty(str) ? str : string.Empty;
    }

    private Bitmap GetStatusImage(string fieldId)
    {
      string simpleField = this._loan.GetSimpleField(fieldId);
      Bitmap statusImage = Resources.grey_dash;
      switch (simpleField)
      {
        case "Apply":
        case "Eligible":
        case "Y":
          statusImage = Resources.check_mark_green;
          break;
        case "Cancel":
        case "N":
        case "NotEligible":
        case "Unavailable":
          statusImage = Resources.red_x_remove;
          break;
      }
      return statusImage;
    }

    private void SetMessageButtonImage(IconButton messageBtn)
    {
      if (!(messageBtn.Name == "freddieIncRepMsgBtn"))
        return;
      string simpleField = this._loan.GetSimpleField("TQL.X94");
      if (simpleField.Contains("23 - ") && simpleField.Contains("8F - ") || simpleField.Contains("FEI0029 - ") && simpleField.Contains("FEI0115 - "))
      {
        messageBtn.Image = (Image) Resources.message_alert_red;
        messageBtn.MouseOverImage = (Image) Resources.message_alert_red_hover;
      }
      else if (simpleField.Contains("23 - ") && (simpleField.Contains("VC - ") || simpleField.Contains("VA - ") || simpleField.Contains("VD - ") || simpleField.Contains("VG - ") || simpleField.Contains("TU - ") || simpleField.Contains("TD - ") || simpleField.Contains("TE - ")) || simpleField.Contains("FEI0029 - ") && (simpleField.Contains("FEI0224 - ") || simpleField.Contains("FEI0226 - ") || simpleField.Contains("FEI0228 - ") || simpleField.Contains("FEI0231 - ") || simpleField.Contains("FEI0230 - ") || simpleField.Contains("FEI0229 - ") || simpleField.Contains("FEI0225 - ")))
      {
        messageBtn.Image = (Image) Resources.message_alert_yellow;
        messageBtn.MouseOverImage = (Image) Resources.message_alert_yellow_hover;
      }
      else
      {
        if ((!simpleField.Contains("24 - ") || !simpleField.Contains("UL - ")) && (!simpleField.Contains("FEI0030 - ") || !simpleField.Contains("FEI0223 - ")))
          return;
        messageBtn.Image = (Image) Resources.message_alert_green;
        messageBtn.MouseOverImage = (Image) Resources.message_alert_green_hover;
      }
    }

