    private string GetTextOrDash(string text)
    {
      return !string.IsNullOrEmpty(text) ? text : "<img src=\"data:image/png;base64, " + this._greyDashImageString + "\">";
    }

    private string GetHtmlMessagesBlock(RepAndWarrantTracker.ItemMessage item)
    {
      if (item.Messages.Count<RepAndWarrantTracker.MessageDetails>((Func<RepAndWarrantTracker.MessageDetails, bool>) (m => m.Message != string.Empty)) == 0)
        return string.Empty;
      string str = "<p style=\"padding-left: 10px; font-weight: bold; \">" + item.Title + "</p><ul>";
      foreach (RepAndWarrantTracker.MessageDetails message in item.Messages)
      {
        if (message.Message != string.Empty)
          str = str + "<li>" + message.Message + "</li>";
      }
      return str + "</ul>";
    }

    private void SaveReport(
      string title,
      string description,
      string company,
      string pdfFilepath,
      string htmlFilepath)
    {
      LogList logList = this._loan.GetLogList();
      DocumentLog documentLog = (DocumentLog) null;
      foreach (DocumentLog allDocument in logList.GetAllDocuments())
      {
        if (allDocument.Title == title && allDocument.PairId == this._loan.PairId && allDocument.RequestedFrom == string.Empty)
          documentLog = allDocument;
      }
      if (documentLog == null)
      {
        DocumentTemplate byName = this._session.LoanDataMgr.SystemConfiguration.DocumentTrackingSetup.GetByName(title);
        documentLog = byName == null ? new DocumentLog(this._session.UserID, this._loan.PairId) : byName.CreateLogEntry(this._session.UserID, this._loan.PairId);
        documentLog.Title = title;
        documentLog.Stage = logList.NextStage;
        documentLog.Description = description;
        logList.AddRecord((LogRecordBase) documentLog);
      }
      documentLog.RequestedFrom = company;
      documentLog.IsePASS = true;
      documentLog.MarkAsRequested(DateTime.Now, this._session.UserID);
      documentLog.MarkAsReceived(DateTime.Now, this._session.UserID);
      this._session.LoanDataMgr.FileAttachments.AddAttachment(AddReasonType.Services, pdfFilepath, documentLog.Title, documentLog, false);
    }

